pragma solidity ^0.4.24;

import "./Ownable.sol";
import "./Water.sol";
import "./Stats.sol";
import "./AUD.sol";
import "./IERC20.sol";
import "./QuickSort.sol";
import "./SafeMath.sol";

contract OrderBook is QuickSort, Ownable {
    using SafeMath for uint;

    IERC20 public _water;
    IERC20 public _aud;
    Stats public _stats;

    enum OrderType { Ask, Offer }

    struct Order {
        OrderType orderType;
        address owner;
        uint256 price;
        uint256 quantity;
        uint256 timeStamp;
        uint256 matchedTimeStamp;
    }

    struct Trade {
        address buyer;
        address seller;
        uint256 averagePrice;
        uint256 quantity;
        uint256 timeStamp;
    }

    Order[] public _asks;
    Order[] public _offers;

    Trade[] public _history;
    string public _tradingZone;


    function averageValueTradedInPeriod(uint256 from, uint256 to) public view returns(uint256) {
        uint256 total = 0;
        uint256 numberOfMatches = 0;

        for (uint i = 0; i < _history.length; i++) {
            if (_history[i].timeStamp >= from && _history[i].timeStamp <= to) {
                total = total.add(_history[i].averagePrice);
                numberOfMatches++;
            }
        }

        if (numberOfMatches == 0) {
            return 0;
        }

        return total.div(numberOfMatches);
    }

    function totalValueTradedInPeriod(uint256 from, uint256 to) public view returns(uint256) {
        uint256 total = 0;

        for (uint i = 0; i < _history.length; i++) {
            if (_history[i].timeStamp >= from && _history[i].timeStamp <= to) {
                total = total.add(_history[i].averagePrice);
            }
        }

        return total;
    }

    function totalVolumeTradedInPeriod(uint256 from, uint256 to) public view returns(uint256) {
        uint256 total = 0;

        for (uint i = 0; i < _history.length; i++) {
            if (_history[i].timeStamp >= from && _history[i].timeStamp <= to) {
                total = total.add(_history[i].quantity);
            }
        }

        return total;
    }

    function manualHistoryAdd(
        address buyer,
        address seller,
        uint256 averagePrice,
        uint256 quantity,
        uint256 timeStamp) public onlyOwner {
        _history.push(Trade(buyer, seller, averagePrice, quantity, timeStamp));
    }

    function getHistory(uint256 numberOfTrades) public view returns(address[], address[], uint256[], uint256[], uint256[]) {
        uint256 max = _history.length < numberOfTrades ? _history.length : numberOfTrades;

        if (max > 1000) {
            max = 1000;
        }

        uint256[] memory sortedIndexes = getTimeHistory();

        address[] memory buyers = new address[](max);
        address[] memory sellers = new address[](max);
        uint256[] memory averagePrices = new uint256[](max);
        uint256[] memory quantities = new uint256[](max);
        uint256[] memory timeStamps = new uint256[](max);

        for(uint256 i = 0; i < max; i++) {
            buyers[i] = _history[sortedIndexes[i]].buyer;
            sellers[i] = _history[sortedIndexes[i]].seller;
            averagePrices[i] = _history[sortedIndexes[i]].averagePrice;
            quantities[i] = _history[sortedIndexes[i]].quantity;
            timeStamps[i] = _history[sortedIndexes[i]].timeStamp;
        }

        return (buyers, sellers, averagePrices, quantities, timeStamps);
    }

    constructor (address statsContract, address waterContract, address audContract, string tradingZone) public {
        _aud = AUD(audContract);
        _stats = Stats(statsContract);
        _water = Water(waterContract);
        _tradingZone = tradingZone;
    }

    function addSellLimitOrder(uint256 price, uint256 quantity) public {
        require(quantity > 0 && price > 0, "Values must be greater than 0");
        require(_water.balanceOf(msg.sender) >= quantity, "Insufficient water allocation");

        _asks.push(Order(OrderType.Ask, msg.sender, price, quantity, now, 0));
        _stats.updateVolumeAvailable(quantity);
        _water.orderBookDebit(msg.sender, quantity);

        emit OrderAdded(msg.sender);
    }

    function addBuyLimitOrder(uint256 price, uint256 quantity) public {
        require(quantity > 0 && price > 0, "Values must be greater than 0");
        require(_aud.balanceOf(msg.sender) >= price * quantity, "Insufficient AUD allocation");

        //Push to array first
        _offers.push(Order(OrderType.Offer, msg.sender, price, quantity, now, 0));
        _aud.orderBookDebit(msg.sender, price * quantity);

        emit OrderAdded(msg.sender);

        uint256 matchedQuantity = 0;

        if (_asks.length > 0) {

            uint256 i = 0;
            uint256[] memory sortedIndexes = getPriceTimeAskOrders();

            while (matchedQuantity < quantity && i < sortedIndexes.length) {

                uint256 j = sortedIndexes[i];

                if ( _asks[j].matchedTimeStamp == 0 && _asks[j].price <= price && _asks[j].quantity == (quantity - matchedQuantity)) {
                    _history.push(Trade(msg.sender, _asks[j].owner, _asks[j].price, _asks[j].quantity, now));
                    _asks[j].matchedTimeStamp = now;

                    matchedQuantity += _asks[j].quantity;

                    //Credit the seller with AUD
                    _aud.orderBookCredit(_asks[j].owner, _asks[j].quantity * price);

                    //Credit the buyer with water
                    _water.orderBookCredit(msg.sender, _asks[j].quantity);

                    emit Matched(_asks[j].owner, _asks[j].price, _asks[j].quantity);
                }

                i++;
            }
        }
    }

    function getOrderBook() public view returns (
        OrderType[],
        address[],
        uint256[],
        uint256[],
        uint256[]
    ) {
        uint256 totalLength = _asks.length + _offers.length;

        OrderType[] memory orderTypes = new OrderType[](totalLength);
        address[] memory owners = new address[](totalLength);
        uint256[] memory prices = new uint256[](totalLength);
        uint256[] memory quantities = new uint256[](totalLength);
        uint256[] memory timeStamps = new uint256[](totalLength);

        for(uint256 i = 0; i < _asks.length; i++) {
            if (_asks[i].matchedTimeStamp == 0) {
                orderTypes[i] = _asks[i].orderType;
                owners[i] = _asks[i].owner;
                prices[i] = _asks[i].price;
                quantities[i] = _asks[i].quantity;
                timeStamps[i] = _asks[i].timeStamp;
            }
        }

        for(uint256 j = 0; j < _offers.length; j++) {
            if (_offers[j].matchedTimeStamp == 0) {
                orderTypes[_asks.length + j] = _offers[j].orderType;
                owners[_asks.length + j] = _offers[j].owner;
                prices[_asks.length + j] = _offers[j].price;
                quantities[_asks.length + j] = _offers[j].quantity;
                timeStamps[_asks.length + j] = _offers[j].timeStamp;
            }
        }

        return (orderTypes, owners, prices, quantities, timeStamps);
    }

    function getOrderBookAsks(uint256 numberOfOrders) public view returns (
        OrderType[],
        address[],
        uint256[],
        uint256[],
        uint256[]
    ) {

        uint256 max = _asks.length < numberOfOrders ? _asks.length : numberOfOrders;

        if (max > 10) {
            max = 10;
        }

        uint256[] memory sortedIndexes = getPriceTimeAskOrders();

        OrderType[] memory orderTypes = new OrderType[](max);
        address[] memory owners = new address[](max);
        uint256[] memory prices = new uint256[](max);
        uint256[] memory quantities = new uint256[](max);
        uint256[] memory timeStamps = new uint256[](max);

        for(uint256 i = 0; i < sortedIndexes.length; i++) {
            orderTypes[i] = _asks[sortedIndexes[i]].orderType;
            owners[i] = _asks[sortedIndexes[i]].owner;
            prices[i] = _asks[sortedIndexes[i]].price;
            quantities[i] = _asks[sortedIndexes[i]].quantity;
            timeStamps[i] = _asks[sortedIndexes[i]].timeStamp;
        }

        return (orderTypes, owners, prices, quantities, timeStamps);
    }

    function getOrderBookOffers(uint256 numberOfOrders) public view returns (
        OrderType[],
        address[],
        uint256[],
        uint256[],
        uint256[]
    ) {

        uint256 max = _offers.length < numberOfOrders ? _offers.length : numberOfOrders;

        if (max > 10) {
            max = 10;
        }

        uint256[] memory sortedIndexes = getPriceTimeOfferOrders();

        OrderType[] memory orderTypes = new OrderType[](max);
        address[] memory owners = new address[](max);
        uint256[] memory prices = new uint256[](max);
        uint256[] memory quantities = new uint256[](max);
        uint256[] memory timeStamps = new uint256[](max);

        for(uint256 i = 0; i < sortedIndexes.length; i++) {
            orderTypes[i] = _offers[sortedIndexes[i]].orderType;
            owners[i] = _offers[sortedIndexes[i]].owner;
            prices[i] = _offers[sortedIndexes[i]].price;
            quantities[i] = _offers[sortedIndexes[i]].quantity;
            timeStamps[i] = _offers[sortedIndexes[i]].timeStamp;
        }

        return (orderTypes, owners, prices, quantities, timeStamps);
    }

    function lowestAsk() public view returns(address, uint256, uint256, uint256) {
        if (_asks.length > 0) {
            uint256[] memory sortedIndexes = getPriceTimeAskOrders();

            uint i = sortedIndexes[0];
            return (_asks[i].owner, _asks[i].price, _asks[i].quantity, _asks[i].timeStamp);
        }

        return (address(0), 0, 0, 0);

    }

    function highestBid() public view returns(address, uint256, uint256, uint256) {
        if (_offers.length > 0) {
            uint256[] memory sortedIndexes = getPriceTimeOfferOrders();

            uint i = sortedIndexes[0];
            return (_offers[i].owner, _offers[i].price, _offers[i].quantity, _offers[i].timeStamp);
        }

        return (address(0), 0, 0, 0);
    }

    function getTimeHistory() internal view returns(uint256[]) {

        uint256[] memory timeStamps = new uint256[](_history.length);
        uint256[] memory indexes = new uint256[](_history.length);

        if (_history.length == 0) {
            return indexes;
        }

        for (uint i = 0; i < _history.length; i++) {
            timeStamps[i] = _history[i].timeStamp;
            indexes[i] = i;
        }

        uint256[] memory sortedIndexes = reverseSortWithIndex(timeStamps, indexes);
        return sortedIndexes;
    }

    function getPriceTimeAskOrders() internal view returns(uint256[]) {
        uint256[] memory prices = new uint256[](_asks.length);
        uint256[] memory indexes = new uint256[](_asks.length);

        if (_asks.length == 0) {
            return indexes;
        }

        for (uint i = 0; i < _asks.length; i++) {
            if (_asks[i].matchedTimeStamp == 0) {
                prices[i] = _asks[i].price;
                indexes[i] = i;
            }
        }

        uint256[] memory sortedIndexes = sortWithIndex(prices, indexes);
        return sortedIndexes;
    }

    function getPriceTimeOfferOrders() internal view returns(uint256[]) {
        uint256[] memory prices = new uint256[](_offers.length);
        uint256[] memory indexes = new uint256[](_offers.length);

        if (_offers.length == 0) {
            return indexes;
        }

        for (uint i = 0; i < _offers.length; i++) {
            if (_offers[i].matchedTimeStamp == 0) {
                prices[i] = _offers[i].price;
                indexes[i] = i;
            }
        }

        uint256[] memory sortedIndexes = reverseSortWithIndex(prices, indexes);
        return sortedIndexes;
    }

    event OrderAdded(address _stats);
    event Matched(address indexed owner, uint256 price, uint256 quantity);
}
